inline const OOD *GetOOD(const void *buf) {
  return ::flatbuffers::GetRoot<OOD>(buf);
}

inline const OOD *GetSizePrefixedOOD(const void *buf) {
  return ::flatbuffers::GetSizePrefixedRoot<OOD>(buf);
}

inline const char *OODIdentifier() {
  return "$OOD";
}

inline bool OODBufferHasIdentifier(const void *buf) {
  return ::flatbuffers::BufferHasIdentifier(
      buf, OODIdentifier());
}

inline bool SizePrefixedOODBufferHasIdentifier(const void *buf) {
  return ::flatbuffers::BufferHasIdentifier(
      buf, OODIdentifier(), true);
}

inline bool VerifyOODBuffer(
    ::flatbuffers::Verifier &verifier) {
  return verifier.VerifyBuffer<OOD>(OODIdentifier());
}

inline bool VerifySizePrefixedOODBuffer(
    ::flatbuffers::Verifier &verifier) {
  return verifier.VerifySizePrefixedBuffer<OOD>(OODIdentifier());
}

inline void FinishOODBuffer(
    ::flatbuffers::FlatBufferBuilder &fbb,
    ::flatbuffers::Offset<OOD> root) {
  fbb.Finish(root, OODIdentifier());
}

inline void FinishSizePrefixedOODBuffer(
    ::flatbuffers::FlatBufferBuilder &fbb,
    ::flatbuffers::Offset<OOD> root) {
  fbb.FinishSizePrefixed(root, OODIdentifier());
}

